import React from 'react';
import { Header } from './components/Header';
import { ClienteList } from './components/ClienteList';

import { GlobalProvider } from './context/GlobalState';

import './App.css';

function App() {
  return (
    <GlobalProvider>
      <Header />
      <div className="container">
        <ClienteList />
      </div>
    </GlobalProvider>
  );
}

export default App;
